void co_oCCur::AlignFP::cat(std::vector<int> *s0,const std::vector<int> &gradient1_peaks, int len)
{
    s0->emplace_back(0);
    if(!gradient1_peaks.empty()) {
        for (const auto &i : gradient1_peaks) {
            s0->emplace_back(i);
        }
    }
    s0->emplace_back(len);
}

void co_oCCur::AlignFP::SumThem(std::vector<int> *s0, const std::vector<int> &gradient1_peaks,
                                const std::vector<int> &gradient2_peaks)
{
    size_t size1 = gradient1_peaks.size();
    size_t size2 = gradient2_peaks.size();
    int ul;
    if(size1!=size2)
    {
        ul = size1 < size2 ? size1 : size2;
    }
    else{
        ul = size1;
    }

    for(int i = 0 ; i < ul; i++)
    {
        int sum = 0;
        sum = gradient1_peaks[i] + gradient2_peaks[i];
        s0->emplace_back(sum);
    }
}

void co_oCCur::AlignFP::DivideThem(std::vector<double> *s0, const std::vector<double> &gradient1_peaks,
                                const std::vector<double> &gradient2_peaks)
{
    size_t size1 = gradient1_peaks.size();
    size_t size2 = gradient2_peaks.size();
    int ul;
    if(size1!=size2)
    {
        ul = size1 < size2 ? size1 : size2;
    }
    else{
        ul = size1;
    }

    for(int i = 0 ; i < ul; i++)
    {
        double quo = 0;
        if(gradient2_peaks[i] != 0) {
            quo = gradient1_peaks[i] / gradient2_peaks[i];
        }
        s0->emplace_back(quo);
    }
}

void co_oCCur::AlignFP::sumIt(std::vector<uint32_t > *s0, const std::vector<std::vector<uint32_t > > &z)
{
    for(const auto &i : z)
    {
        s0->emplace_back(std::accumulate(i.begin(), i.end(), 0.0));
    }
}

void co_oCCur::AlignFP::bitwise_and(std::vector<std::vector<uint32_t > > *s0, const std::vector<std::vector<uint32_t > > &z, const std::vector<uint32_t > &y)
{
    for(auto i : z)
    {
        std::vector<uint32_t > p;
        for(auto j: y)
        {
            p.emplace_back(i.at(0) & j);
        }
        s0->emplace_back(p);
    }
}

void co_oCCur::AlignFP::right_shift(std::vector<std::vector<uint32_t > > *s0, const std::vector<std::vector<uint32_t > > &z, const std::vector<uint32_t > &y)
{
    for(const auto& i : z)
    {
        std::vector<uint32_t > p;
        for(auto j=0; j < 32; j++)
        {
            p.emplace_back(i.at(j) >> y[j]);
        }
        s0->emplace_back(p);
    }
}

