double co_oCCur::AlignFP::mean(const std::vector<double> &InVector)
{
    if(!InVector.empty())
    {
        return std::accumulate(InVector.begin(), InVector.end(), 0.0)/ InVector.size();
    }
    return 0;
}

double co_oCCur::AlignFP::index_to_secs(int index)
{
    return index * chroma_factor;
}

